PRAGMA foreign_keys=ON;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "users" ("id" integer primary key autoincrement not null, "name" varchar not null, "business_name" varchar not null default 'my business', "image" varchar, "email" varchar not null, "email_ve
            rified_at" datetime, "password" varchar not null, "isadmin" tinyint(1) not null default '0', "remember_token" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "password_reset_tokens" ("email" varchar not null, "token" varchar not null, "created_at" datetime, primary key ("email"));
CREATE TABLE IF NOT EXISTS "sessions" ("id" varchar not null, "user_id" integer, "ip_address" varchar, "user_agent" text, "payload" text not null, "last_activity" integer not null, primary key ("id"));
CREATE TABLE IF NOT EXISTS "cache" ("key" varchar not null, "value" text not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "cache_locks" ("key" varchar not null, "owner" varchar not null, "expiration" integer not null, primary key ("key"));
CREATE TABLE IF NOT EXISTS "jobs" ("id" integer primary key autoincrement not null, "queue" varchar not null, "payload" text not null, "attempts" integer not null, "reserved_at" integer, "available_at" integer not null, "created_at" integer not null);
CREATE TABLE IF NOT EXISTS "job_batches" ("id" varchar not null, "name" varchar not null, "total_jobs" integer not null, "pending_jobs" integer not null, "failed_jobs" integer not null, "failed_job_ids" text not null, "options" text, "cancelled_at" integer, "created_at" integer not null, "finished_at" integer, primary key ("id"));
CREATE TABLE IF NOT EXISTS "failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "personal_access_tokens" ("id" integer primary key autoincrement not null, "tokenable_type" varchar not null, "tokenable_id" integer not null, "name" varchar not null, "token" varchar not null, "abilities" text, "last_used_at" datetime, "expires_at" datetime, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "categories" ("id" integer primary key autoincrement not null, "name" varchar not null, "description" varchar not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "posts" ("id" integer primary key autoincrement not null, "title" varchar not null, "description" text not null, "image" text, "category_id" integer not null, "user_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("category_id") references "categories"("id") on delete cascade on update cascade, foreign key("user_id") references "users"("id") on delete cascade on update cascade);
CREATE TABLE IF NOT EXISTS "events" ("id" integer primary key autoincrement not null, "title" varchar not null, "description" text not null, "url" varchar, "image" text, "start" date not null default '2025-05-04 23:43:29', "end" date not null default '2025-05-04 23:43:29', "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "resources" ("id" integer primary key autoincrement not null, "title" varchar not null, "description" text not null, "url" varchar, "file" text not null, "type" varchar check ("type" in ('video', 'image', 'document')) not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "services" ("id" integer primary key autoincrement not null, "title" varchar not null, "description" text not null, "image" text, "user_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("user_id") references "users"("id") on delete cascade on update cascade);
CREATE TABLE IF NOT EXISTS "podcasts" ("id" integer primary key autoincrement not null, "title" varchar not null, "description" text not null, "audio" text, "category_id" integer not null, "user_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("category_id") references "categories"("id") on delete cascade on update cascade, foreign key("user_id") references "users"("id") on delete cascade on update cascade);
CREATE TABLE IF NOT EXISTS "quizzes" ("id" integer primary key autoincrement not null, "name" varchar not null, "description" varchar not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "questions" ("id" integer primary key autoincrement not null, "question_text" text not null, "quiz_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("quiz_id") references "quizzes"("id") on delete cascade on update cascade);
CREATE TABLE IF NOT EXISTS "options" ("id" integer primary key autoincrement not null, "question_id" integer not null, "option_text" varchar not null, "option_label" varchar check ("option_label" in ('A', 'B', 'C', 'D')) not null, "is_correct" tinyint(1) not null default '0', "created_at" datetime, "updated_at" datetime, foreign key("question_id") references "questions"("id") on delete cascade on update cascade);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "users_email_unique" on "users" ("email");
CREATE INDEX "sessions_user_id_index" on "sessions" ("user_id");
CREATE INDEX "sessions_last_activity_index" on "sessions" ("last_activity");
CREATE INDEX "jobs_queue_index" on "jobs" ("queue");
CREATE UNIQUE INDEX "failed_jobs_uuid_unique" on "failed_jobs" ("uuid");
CREATE INDEX "personal_access_tokens_tokenable_type_tokenable_id_index" on "personal_access_tokens" ("tokenable_type", "tokenable_id");
CREATE UNIQUE INDEX "personal_access_tokens_token_unique" on "personal_access_tokens" ("token");
COMMIT;
